import{o as e,c as a,a6 as t}from"./index.e53ce348.js";const c={class:"markdown-body"},i=t('<p><div class="toc-box"><ul><li><a href="javascript:document.querySelector(&#39;#_3&#39;).scrollIntoView({behavior: &#39;smooth&#39;})">\u4E3A\u4EC0\u4E48\u6211\u4E0D\u80FD\u4FDD\u5B58\u6211\u7684\u9875\u9762\uFF1F</a></li><li><a href="javascript:document.querySelector(&#39;#XXXX_9&#39;).scrollIntoView({behavior: &#39;smooth&#39;})">\u4E3A\u4EC0\u4E48\u6CA1\u6709XXXX\u7EC4\u4EF6\uFF1F</a></li><li><a href="javascript:document.querySelector(&#39;#_17&#39;).scrollIntoView({behavior: &#39;smooth&#39;})">\u600E\u4E48\u53BB\u5F00\u53D1\u4E00\u4E2A\u65B0\u7EC4\u4EF6\uFF1F</a></li><li><a href="javascript:document.querySelector(&#39;#NPM_27&#39;).scrollIntoView({behavior: &#39;smooth&#39;})">\u6211\u7684\u7EC4\u4EF6\u4F9D\u8D56\u548C\u5176\u4ED6\u7EC4\u4EF6\u516C\u7528\u4E00\u4E2A`NPM`\u5305\uFF0C\u4F46\u662F\u7248\u672C\u4E0D\u4E00\u6837\u600E\u4E48\u529E\uFF1F</a></li><li><a href="javascript:document.querySelector(&#39;#_33&#39;).scrollIntoView({behavior: &#39;smooth&#39;})">\u60F3\u81EA\u5DF1\u5F00\u53D1\u540E\u53F0\uFF0C\u5982\u4F55\u77E5\u9053\u672C\u9879\u76EE\u7684\u63A5\u53E3\uFF1F</a></li></ul></div></p><h1><a id="_3"></a>\u4E3A\u4EC0\u4E48\u6211\u4E0D\u80FD\u4FDD\u5B58\u6211\u7684\u9875\u9762\uFF1F</h1><p>openDataV \u662F\u4E00\u6B3E\u57FA\u4E8EVue3\u7684\u7EAF\u524D\u7AEF\u62D6\u62FD\u5F0F\u4F4E\u4EE3\u7801\u5E73\u53F0\uFF0C\u9ED8\u8BA4\u6240\u6709\u7684\u63A5\u53E3\u90FD\u662FMock\u63A5\u53E3\uFF0C\u56E0\u6B64\u4F60\u4E0D\u80FD\u8FDB\u884C\u4EFB\u4F55\u5199\u64CD\u4F5C,\u56E0\u6B64\u4FDD\u5B58\u66F4\u65B0\u4E4B\u7C7B\u7684\u64CD\u4F5C\u662F\u65E0\u6548\u679C\u7684\uFF1B\u56E0\u4E3A\u65F6\u95F4\u548C\u7CBE\u529B\u4E0D\u8DB3\uFF0C\u6211\u4EEC\u5F00\u53D1\u4E86\u4E00\u4E2A\u7B80\u6613\u7684\u540E\u53F0\u670D\u52A1<a href="https://gitee.com/small_bud_star/open-data-backend">https://gitee.com/small_bud_star/open-data-backend</a>,\u4FBF\u4E8E\u5927\u5BB6\u4F7F\u7528\uFF0C\u4F46\u662F\u5E76\u4E0D\u9002\u5408\u5728\u751F\u4EA7\u73AF\u5883\u4E2D\u4F7F\u7528</p><p>\u6211\u4EEC\u4E5F\u6253\u7B97\u5F00\u53D1\u4E00\u4E2A\u9AD8\u6027\u80FD\u7684\u540E\u53F0\u670D\u52A1\uFF0C\u8BA1\u5212\u91C7\u7528Spring\u5957\u88C5\u6216\u8005Go\u8BED\u8A00\uFF0C\u611F\u5174\u8DA3\u7684\u5927\u4F6C\u53EF\u4EE5\u52A0\u5165\u6211\u4EEC\u4E00\u8D77\u5F00\u53D1</p><h1><a id="XXXX_9"></a>\u4E3A\u4EC0\u4E48\u6CA1\u6709XXXX\u7EC4\u4EF6\uFF1F</h1><p>\u6211\u4EEC\u5BF9OpenDataV\u7684\u5B9A\u4F4D\u66F4\u591A\u662F\u4E00\u4E2A\u5E73\u53F0\u6027\u8D28\u6216\u8005\u6846\u67B6\u6027\u8D28\uFF0C\u6240\u4EE5\u81EA\u5E26\u7684\u7EC4\u4EF6\u66F4\u591A\u662F\u793A\u4F8B\u529F\u80FD\u3002</p><p>\u6211\u4EEC\u5728\u5B9E\u9645\u5E94\u7528\u4E2D\u53D1\u73B0\uFF0C\u7EC4\u4EF6\u7684\u901A\u7528\u6027\u548C\u590D\u6742\u5EA6\u6210\u53CD\u6BD4\uFF0C\u5982\u679C\u4E00\u4E2A\u7EC4\u4EF6\u901A\u7528\u6027\u5F88\u5F3A\uFF0C\u90A3\u4E48\u5B83\u7684\u590D\u6742\u5EA6\u5C31\u5F88\u9AD8\uFF0C\u7528\u6237\u7684\u7684\u5B66\u4E60\u6210\u672C\u5C31\u4F1A\u5F88\u5927\uFF0C\u8FD9\u6837\u5C31\u5931\u53BB\u4E86\u4F4E\u4EE3\u7801\u7684\u610F\u4E49\uFF1B\u65E2\u7136\u505A\u4E0D\u5230\u901A\u7528\u6027\u5F3A\uFF0C\u6211\u4EEC\u7684\u5DE5\u4F5C\u91CD\u70B9\u4E5F\u4E0D\u4F1A\u653E\u5728\u7EC4\u4EF6\u5F00\u53D1\u4E0A\uFF1B\u5F53\u7136\u6211\u4EEC\u4E5F\u4F1A\u53BB\u5F00\u53D1\u4E00\u4E9B\u6709\u8F83\u5927\u901A\u7528\u6027\u7684\u7EC4\u4EF6\uFF0C\u4F46\u662F\u7AD9\u5728\u4E2A\u4EBA\u7ECF\u9A8C\u6765\u8BF4\uFF0C\u7EC4\u4EF6\u7684\u5F00\u53D1\u672C\u8EAB\u5E94\u8BE5\u662F\u7ED3\u5408\u4E1A\u52A1\uFF0C\u6839\u636E\u5177\u4F53\u4E1A\u52A1\u6709\u4FA7\u91CD\u70B9\u7684\u5F00\u53D1\uFF0C\u65E2\u80FD\u6EE1\u8DB3\u4E1A\u52A1\u9700\u6C42\u7684\u53D8\u5316\uFF0C\u53C8\u7B80\u5355\u6613\u4E0A\u624B\u3002</p><p>\u540E\u671F\u4E0D\u6392\u9664\u6211\u4EEC\u4F1A\u9488\u5BF9\u67D0\u4E2A\u884C\u4E1A\u53BB\u5F00\u53D1\u4E00\u6210\u5957\u7684\u7EC4\u4EF6\uFF0C\u540C\u65F6\u5982\u679C\u5404\u4F4D\u8001\u677F\u6709\u5B9A\u5236\u7EC4\u4EF6\u7684\u5F00\u53D1\u9700\u6C42\uFF0C\u6211\u4EEC\u4E5F\u4E0D\u6392\u9664\u53BB\u63A5\u4E00\u4E9B\u5B9A\u5236\u7EC4\u4EF6\u5F00\u53D1\u7684\u517C\u804C\u3002</p><h1><a id="_17"></a>\u600E\u4E48\u53BB\u5F00\u53D1\u4E00\u4E2A\u65B0\u7EC4\u4EF6\uFF1F</h1><ol><li>\u5B66\u4E60\u5F00\u53D1\u6587\u6863</li><li>\u5B66\u4E60\u5B98\u65B9\u7EC4\u4EF6\u4F8B\u5B50</li><li>\u5173\u6CE8\u516C\u4F17\u53F7\uFF0C\u67E5\u770B\u5F80\u671F\u6587\u7AE0</li><li>\u548C\u793E\u533A\u540C\u4F34\u4EA4\u6D41</li></ol><p>\u540C\u65F6\u5E0C\u671B\u5927\u5BB6\u5411\u672C\u9879\u76EE\u8D21\u732E\u81EA\u5DF1\u7684\u7EC4\u4EF6\uFF0C\u88AB\u5B98\u65B9\u6536\u5F55\u7684\u7EC4\u4EF6\u8BF7\u4FDD\u8BC1\u7EC4\u4EF6\u6709\u8F83\u5927\u7684\u901A\u7528\u6027\u3001\u5B8C\u5584\u7684\u793A\u4F8B\u6587\u6863\uFF0C\u4E14\u548C\u672C\u9879\u76EE\u4FDD\u6301\u4E00\u81F4\u7684\u5F00\u6E90\u8BB8\u53EF\u8BC1\uFF0C \u5982\u679C\u672A\u4E0A\u4F20\u5F00\u6E90\u8BB8\u53EF\u8BC1\uFF0C\u9ED8\u8BA4\u91C7\u7528\u672C\u9879\u76EE\u7684\u8BB8\u53EF\u8BC1\u3002</p><h1><a id="NPM_27"></a>\u6211\u7684\u7EC4\u4EF6\u4F9D\u8D56\u548C\u5176\u4ED6\u7EC4\u4EF6\u516C\u7528\u4E00\u4E2A<code>NPM</code>\u5305\uFF0C\u4F46\u662F\u7248\u672C\u4E0D\u4E00\u6837\u600E\u4E48\u529E\uFF1F</h1><p>\u6574\u4E2AOpenDataV\u662F\u91C7\u7528<code>Monorepo</code>\u65B9\u5F0F\u7BA1\u7406\u7EC4\u4EF6\u4EE5\u53CA\u4F9D\u8D56\uFF0C\u4E25\u683C\u610F\u4E49\u4E0A\u6765\u8BF4\uFF0C\u6BCF\u4E2A\u7EC4\u4EF6\u90FD\u662F\u72EC\u7ACB\u7684\uFF0C\u6BCF\u4E2A\u7EC4\u4EF6\u6709\u81EA\u5DF1\u7684<code>\u7C7B\u578B\u6587\u4EF6</code>\u3001<code>\u4F9D\u8D56\u5305</code>\u548C<code>\u8BB8\u53EF\u8BC1</code>\uFF0C\u5220\u9664\u4EFB\u4F55\u4E00\u4E2A\u7EC4\u4EF6\u4E0D\u5F71\u54CD\u5176\u4ED6\u7EC4\u4EF6\u7684\u4F7F\u7528\u3002\u6240\u4EE5\u5BF9\u4E8E\u540C\u4E00\u4E2A\u5305\u7684\u4E0D\u540C\u7248\u672C\uFF0C\u53EA\u8981\u5728\u5404\u81EA\u7684\u4F9D\u8D56\u4E2D\u6DFB\u52A0\u5BF9\u5E94\u7684\u7248\u672C\u5373\u53EF\uFF0C\u4E5F\u53EF\u4EE5\u50CF\u5B98\u65B9\u7EC4\u4EF6\u4E00\u6837\uFF0C\u591A\u4E2A\u7EC4\u4EF6\u5171\u4EAB\u540C\u4E00\u4E2A\u4F9D\u8D56\u3002</p><p>\u540C\u65F6\u5BF9\u4E8E\u5B98\u65B9\u7EC4\u4EF6\u4F60\u4E5F\u53EF\u4EE5\u6309\u9700\u5F15\u5165\uFF0C\u5BF9\u4E8E\u81EA\u5DF1\u7528\u4E0D\u5230\u7684\u53EF\u4EE5\u5220\u9664\uFF0C\u4E0D\u4F1A\u6709\u4EFB\u4F55\u95EE\u9898</p><h1><a id="_33"></a>\u60F3\u81EA\u5DF1\u5F00\u53D1\u540E\u53F0\uFF0C\u5982\u4F55\u77E5\u9053\u672C\u9879\u76EE\u7684\u63A5\u53E3\uFF1F</h1><p>\u53EF\u4EE5\u67E5\u770B\u9879\u76EE <code>src\\api</code>\u63A5\u53E3\u6587\u4EF6\u548C\u7C7B\u578B\u6587\u4EF6\uFF0C\u5F53\u7136\u4F60\u53EF\u4EE5\u968F\u610F\u66F4\u6539\u8FD9\u4E9B\u63A5\u53E3\u5B9A\u4E49</p>',16),r=[i],h={__name:"CommonIssues",setup(l,{expose:o}){return o({frontmatter:{}}),(p,d)=>(e(),a("div",c,r))}};export{h as default};
